DROP TABLE IF EXISTS wx_hotels;
DROP TABLE IF EXISTS wx_regions;

CREATE TABLE wx_regions ( 
  rcode varchar(3) NOT NULL,
  rcate varchar(1),
  rname varchar(32),
  cname varchar(64),
  PRIMARY KEY (rcode)
) ENGINE=MyISAM;

CREATE TABLE wx_hotels (
  hid int(5) NOT NULL auto_increment,
  hname varchar(80) NOT NULL,
  hcode varchar(5) NOT NULL,
  rcode varchar(3) NOT NULL,
  habbr varchar(16),
  hstars decimal(3,1) default 3.0,
  haddress varchar(64),
  hcity varchar(32),
  hstate varchar(16),
  hzipcode varchar(16),
  hcountry varchar(16),
  hphone varchar(20),
  hfax varchar(20),
  hemail varchar(32),
  hdesc varchar(128),
  hnew int(1) default 0,
  hdeleted int(1) default 0,
  hprice decimal(6,2) default 0.0,
  hpcomment varchar(32),
  huprice decimal(6,2) default 0.0,
  hcost decimal(6,2) default 0.0,
  hucost decimal(6,2) default 0.0,
  horder int(3),
  hwifi varchar(60),
  hsprice decimal(6,2) default 0.0,
  hscost decimal(6,2) default 0.0,
  hbrkfst char(1),
  hselected varchar(1),
  hemail2 varchar(32),
  hphone2 varchar(20),
  hprice2 decimal(6,2) default 0.0,
  hsprice2 decimal(6,2) default 0.0,
  huprice2 decimal(6,2) default 0.0,
  hcost2 decimal(6,2) default 0.0,
  hscost2 decimal(6,2) default 0.0,
  hucost2 decimal(6,2) default 0.0,
  hprice3 decimal(6,2) default 0.0,
  hsprice3 decimal(6,2) default 0.0,
  huprice3 decimal(6,2) default 0.0,
  hcost3 decimal(6,2) default 0.0,
  hscost3 decimal(6,2) default 0.0,
  hucost3 decimal(6,2) default 0.0,
  haname varchar(32),
  hsname varchar(32),
  PRIMARY KEY (hid),
  FOREIGN KEY (rcode) REFERENCES wx_regions (rcode)
) ENGINE=MyISAM;

